  "privacy_content": "<h2>Politica de Confidențialitate</h2> <p>Această notificare privind confidențialitatea se aplică utilizării produsului Informații Electronice despre Produs al Asociației PharmaLedger.</p> <h2>Contacte</h2><p><b>a) Identitatea și contactele operatorului sau ale operatorilor asociați </b></p><p>Operatorul datelor dvs. este Asociația PharmaLedger.</p> <p><b>b) Datele de contact ale responsabilului cu protecția datelor </b></p><p>Biroul pentru Protecția Datelor al Asociației PharmaLedger poate fi contactat la dpo@pharmaledger.org.</p><h2>Ce Date cu Caracter Personal Folosim</h2><p> Colectăm doar datele tehnice necesare pentru livrarea prospectului electronic. Acestea includ adresa dvs. IP și identificatorii tehnici ai dispozitivului și browserului pe care îl utilizați pentru a accesa aplicația noastră.</p> <p><em>În detaliu, colectăm următoarele elemente de date: </em></p><ul><li><p><em>Acces la Dispozitive Mobile.</em> Este posibil să solicităm acces sau permisiune la anumite funcții de pe dispozitivul dvs. mobil, inclusiv camera dispozitivului dvs. mobil și alte funcții. Dacă doriți să modificați accesul sau permisiunile noastre, puteți face acest lucru în setările dispozitivului dvs. </p></li><li><p><em>Datele Dispozitivului Mobil.</em> Colectăm automat informații despre dispozitiv (cum ar fi ID-ul dispozitivului dvs. mobil, modelul și producătorul), informații despre sistemul de operare, informații despre versiune și informații despre configurația sistemului, numerele de identificare a dispozitivului și aplicației, tipul și versiunea browserului, modelul hardware, furnizorul de servicii Internet și/ sau operatorul de telefonie mobilă și adresa IP (sau serverul proxy). Dacă utilizați aplicația (aplicațiile) noastră, putem colecta, de asemenea, informații despre rețeaua de telefonie asociată dispozitivului dvs. mobil, sistemul de operare sau platforma dispozitivului dvs. mobil, tipul de dispozitiv mobil pe care îl utilizați, ID ul unic al dispozitivului dvs. mobil și informații despre caracteristicile aplicației (aplicațiilor) noastre pe care le-ați accesat. </p></li></ul><h2>De Ce Vă Colectăm Datele Cu Caracter Personal </h2><h3>Scopuri</h3><p>Colectăm datele dvs. tehnice în scopul de a vă oferi un prospect electronic de produs pentru medicamentele dvs.</p><p>Ca atare, ne putem baza pe următoarele temeiuri juridice pentru a procesa informațiile dvs. Personale: </p><ul><li><p><b>Executarea unui Contract.</b> Putem procesa informațiile dvs. personale atunci când considerăm că este necesar să ne îndeplinim obligațiile contractuale față de dvs., inclusiv furnizarea Serviciilor noastre sau la cererea dvs. înainte de a încheia un contract cu dvs. </p></li><li><p><b>Obligații Legale.</b> Putem procesa informațiile dvs. în cazul în care considerăm că este necesar pentru respectarea obligațiilor noastre legale, cum ar fi îndeplinirea obligațiilor noastre în conformitate cu reglementările privind asistența medicală și legislația privind sănătatea publică. </p></li></ul><h2>Cu Cine Partajăm Datele Dumneavoastră cu Caracter Personal</h2><p>Companii Membre și Furnizori Terți de Servicii.</p><p> Partajăm datele dvs. cu furnizori, furnizori de servicii, contractori sau agenți terți (\"terțe părți\") care prestează servicii pentru noi sau în numele nostru și necesită acces la astfel de informații pentru a face această muncă. Avem contracte în vigoare cu terții noștri, care sunt concepute pentru a ajuta la protejarea informațiilor dvs. personale. Aceasta înseamnă că nu pot face nimic cu informațiile dvs. personale decât dacă le-am transmis să o facă. De asemenea, nu vor împărtăși informațiile dvs. personale cu nicio organizație în afară de noi. De asemenea, se angajează să protejeze datele pe care le dețin în numele nostru și să le păstreze pentru perioada pe care o stabilim. Categoriile de terțe părți cu care putem partaja informații personale sunt următoarele:</p><ul><li><p> Producătorii de Medicamente (Companii Membre)</p></li><li><p>Furnizori de Servicii Tehnice</p></li></ul><h2>Cât Timp Stocăm Datele Dumneavoastră Cu Caracter Personal</h2><p>Asociația PharmaLedger stochează datele dvs. tehnice numai atâta timp cât este necesar pentru a procesa solicitarea dvs. de prospect timp de până la 30 de zile. </p><p>Producătorul medicamentului dvs. va stoca, de asemenea, datele dvs. pentru o perioadă definită de timp, determinată de politicile lor de păstrare a datelor, pentru mai multe informații despre această păstrare, vă rugăm să luați legătura cu producătorul medicamentului.</p><h2>Dacă Nu Ne Furnizați Datele Dvs. Personale </h2><p>Dacă alegeți să nu ne furnizați datele dvs. tehnice, nu vom putea îndeplini solicitarea dvs. de prospect.</p><h2>Drepturile Dumneavoastră</h2><p>Dacă aveți solicitări legate de datele dvs. personale în temeiul GDPR, cum ar fi o solicitare de accesare sau ștergere a datelor dvs., ne puteți contacta la dpo@pharmaledger.org.</p><p>Vom procesa astfel de solicitări în termen de 30 de zile.</p><h2>Retragerea Acordului</h2><p>Dacă aveți solicitări legate de datele dvs. personale în temeiul GDPR, cum ar fi o solicitare de accesare sau ștergere a datelor dvs., ne puteți contacta la dpo@pharmaledger.org.</p><p> Vom procesa astfel de solicitări în termen de 30 de zile.</p><h2>Procesul Decizional Automatizat </h2><p>Nu utilizăm niciun proces decizional automatizat pentru a vă furniza acest serviciu.</p><h2>Transferul Internațional De Date cu Caracter Personal </h2><p> În cazul în care producătorul dvs. de medicamente ne solicită să transferăm datele dvs. în afara Uniunii Europene, folosim clauze contractuale standard pentru a vă proteja datele.</p><h2>Cum să Depuneți o Plângere</h2><p>Dacă aveți solicitări legate de datele dvs. personale în temeiul GDPR, cum ar fi o solicitare de accesare sau ștergere a datelor dvs., ne puteți contacta la dpo@pharmaledger.org.</p><p>Vom procesa astfel de solicitări în termen de 30 de zile. În plus, puteți contacta autoritatea locală de supraveghere în cazul în care considerați că drepturile dumneavoastră nu sunt respectate.</p>",
