  "terms_content": "<h2>Termeni și Condiții pentru Site-ul web și Aplicația de Informații Electronice despre Produs a Asociației PharmaLedger </h2><p>Prin accesarea sau utilizarea site-ului web și a aplicației de Informații Electronice despre Produs a Asociației PharmaLedger (\"Serviciile\"), sunteți de acord să respectați acești termeni și condiții (\"Termenii\"). Nu puteți accesa sau utiliza Serviciile dacă nu sunteți de acord cu acești Termeni. Serviciile sunt operate de Asociația PharmaLedger (\"Asociația\") și sunt destinate utilizării de către persoanele care caută informații despre medicamentele lor. O rețea de părți multipartită furnizează Serviciile, iar producătorul dvs. de medicamente furnizează informațiile despre produs afișate prin intermediul Serviciilor. Asociația acționează ca operator de date pentru aceste informații. </p><h2>Folosirea Serviciilor </h2><p>Sunteți de acord să utilizați Serviciile numai în scopuri legale și într-o manieră care nu încalcă drepturile, nu restricționează sau nu împiedică utilizarea și exploatarea Serviciilor de către nicio terță parte. O astfel de restricție sau inhibare include, fără limitare, un comportament ilegal sau care poate hărțui sau provoca suferință sau inconveniente oricărei persoane și transmiterea de conținut obscen sau ofensator sau întreruperea fluxului normal de dialog în cadrul Serviciilor. </p><h2>Proprietate Intelectuală </h2><p>Conținutul Serviciilor, inclusiv, dar fără a se limita la, text, grafică, imagini și software, este proprietatea Asociației sau a licențiatorilor săi și a companiilor membre și este protejat de drepturile de autor și alte legi privind proprietatea intelectuală. Nu puteți utiliza niciun conținut din Servicii în niciun scop comercial fără acordul scris expres al Asociației. </p><h2>Responsabilitate</h2><p>Asociația nu face nicio declarație sau garanție de niciun fel, expresă sau implicită, cu privire la funcționarea Serviciilor sau a informațiilor, conținutului, materialelor sau produselor incluse în Servicii. Asociația nu va fi răspunzătoare pentru niciun fel de daune care decurg din utilizarea Serviciilor, inclusiv, dar fără a se limita la, daune directe, indirecte, accidentale, punitive și pe cale de consecință. </p><h2>Legea Aplicabilă </h2><p>Acești Termeni și utilizarea de către dvs. a Serviciilor vor fi guvernate și interpretate în conformitate cu legile Elveției și orice litigii vor fi soluționate în instanțele din Basel, Elveția. </p><h2>Modificări ai Termenilor </h2><p>Asociația își rezervă dreptul de a modifica acești Termeni în orice moment, iar dvs. sunteți responsabil pentru verificarea periodică a acestor Termeni pentru orice modificări. Utilizarea în continuare a Serviciilor după efectuarea oricăror modificări ale Termenilor va constitui acceptarea de către dvs. a Termenilor revizuiți.</p><p><br></p>",
