  "about_content": "<h2>Despre această aplicație</h2><p>Această aplicație vă este furnizată de PharmaLedger®. Acesta a fost dezvoltată în comun de organizații reprezentative ale pacienților, companii farmaceutice și experți în tehnologie.</p><p>Aceasta permite utilizatorilor aplicației să vizualizeze informații despre medicamentul lor prin scanarea codului de bare de pe ambalajul produsului.</p><p>Informațiile prezentate sunt furnizate de deținătorul autorizației de punere pe piață a produsului.</p><h2>Despre PharmaLedger</h2><p>PharmaLedger® este numele de marcă al Asociației PharmaLedger (PLA).</p><p>PLA este o asociație globală non-profit, neutră. Scopul Asociației este de a crea și promova un ecosistem digital de încredere în domeniul sănătății.</p><p>Asociația promovează cooperarea în sectoarele sănătății și științelor vieții și promovează inovațiile și implementarea acestora în beneficiul reciproc al pacienților și al altor părți interesate.</p>",
