  "help_content": "<div><p><b><h2>Ce este EPI? </h2></b></p><p> <b>EPI</b> este o abreviere pentru <b>informațiile electronice despre produs.</b> Este o versiune electronică a prospectului pe suport de hârtie cu informații despre produs pe care îl găsiți de obicei în interiorul unui ambalaj al unui produs farmaceutic sau care însoțește un produs farmaceutic. În unele cazuri, este posibil ca <b>EPI</b> să fi înlocuit prospectul pe hârtie. </p><p><b><h2>Ce este PharmaLedger? </h2></b></p><p>Asociația PharmaLedger (PLA) este o asociație non-profit cu sediul în Elveția, având scopul de a crea posibilitatea și încuraja un ecosistem digital de încredere în domeniul asistenței medicale printr-o platformă de tip sursă deschisă (open-source) standardizată și de încredere. PLA promovează colaborarea și accelerează inovația și adoptarea pentru a obține beneficii reciproce în domeniile îngrijirii sănătății și științelor vieții pentru pacienți și alte părți interesate. PLA a fost înființată în 2022 pentru a continua activitatea proiectului PharmaLedger, un proiect de 3 ani finanțat de Comisia Europeană și industria farmaceutică care vizează dovedirea valorii soluțiilor blockchain. Informații suplimentare sunt disponibile la https://pharmaledger.org.</p><p><b><h2>Ce este DataMatrix? </h2></b></p><p>Este un tip de cod de bare pe pachetul produsului. Este un cod de bare pătrat alb-negru și va arăta similar cu acesta:<br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>Cum folosesc aplicația? </h2></b></p><p>Urmați instrucțiunile de pe pagina de destinație a <b>Aplicației...</b> afișează o imagine a locului unde puteți găsi <b>DataMatrix</b> e pachetul produsului. După ce ați găsit <b>DataMatrix</b>, faceți clic pe butonul \"Scanare <b>DataMatrix</b>\". Permiteți aplicației să utilizeze camera, astfel încât <b>DataMatrix</b> să poată fi scanat. Utilizați camera pentru a focaliza pe <b>DataMatrix</b>. Odată ce pachetul este scanat cu succes, <b>EPI</b> va fi afișat. Puteți face clic pe butonul \"+\" pentru a obține mai multe detalii.</p><p><b><h2>De ce scanarea DataMatrix nu oferă niciun rezultat?</h2></b></p><p>Există mai multe motive pentru care <b>DataMatrix</b> de pe pachetul dvs. nu poate oferi un EPI. Unul dintre motive ar putea fi focalizarea camerei. Vă rugăm să încercați să scanați codul într-un loc bine luminat și codul clar vizibil pe ecran. Dacă aveți dificultăți în a vă menține mâna stabilă, puteți încerca să utilizați o masă pentru a vă sprijini mâinile.</p></div>",
